import s from "./style.module.css";

interface IProps {
  path: string;
  name: string;
}

const BreadCrumbs: React.FC<IProps> = (props) => {
  return (
    <ul className={s.breadcrumbs}>
      <li>{props.path}Players</li>
      <li>{props.name}Greg Whittington</li>
    </ul>
  );
};

export default BreadCrumbs;
